import React, { Component } from 'react';

class MainVideo extends Component {
    render(props) {
        if(!this.props.video) {
            return <div></div>
        }

        const link = `https://www.youtube.com/embed/${this.props.video.id.videoId}` 
        return ( 
            <div className = "col-md-6">
                <div >
                    <iframe
                        style={{width: "560", height: 315}}  
                        src={link} 
                        title={this.props.video.snippet.title}
                    />
                </div>
                <div>
                    <h5 className = 'font-weight-bold'>{this.props.video.snippet.title}</h5>
                    <p>{this.props.video.snippet.description}</p>
                </div>
            </div>
         );
    }
}

<iframe width="560" height="315" src="https://www.youtube.com/embed/O7cwFYAQvEU" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
export default MainVideo;
